import React from "react";
import textinfo from "../textInfo"

let homepageInfo = textinfo.homepageInfo

let expDiv = (data) =>{
    return(
        <div className='expDiv'>
            <div className='companyName'>{data.company}<span className='location'>{data.location}</span></div>
    <div className='position'>{data.position} <span className='time'>{data.time}</span></div>
        </div>
    )
}

let leftSide = <div className='leftSide'>
                    <div className='title'>
                        {homepageInfo.leftSideTitle}
                    </div>
                    <div className='subtitle'>
                        {homepageInfo.leftSideSubtitle}
                    </div>
               </div>
let rightSide = <div className='rightSide'>
                    <div className='work'>

                    </div>
                    <div className='edcuation'>

                    </div>
                </div>

// let profileBody = 
class Profile extends React.Component{
    render(){

        return (
            <div className='Profile'>
                {leftSide}{rightSide}
            </div>
        )
    }
}

export default Profile
